window.Dialogs=function(msg,callback,title){var div=document.createElement("div");div.id="dialogsBox";div.innerHTML='<style type="text/css">#dialogs{position:relative;display:none}#dialogsMask{position:fixed;z-index:99;top:0;left:0;height:100vh;width:100vw;background-color:rgb(0, 0, 0);opacity:.8;cursor:pointer}.dialogs_body{position:fixed;z-index:100;width:20%;min-width:250px;top:50%;left:50%;padding:15px;-webkit-transform:translate(-50%, -50%);transform:translate(-50%, -50%);background-color:#fff;text-align:center;border-radius:8px;overflow:hidden;opacity:1;box-shadow:0 0 15px rgba(0, 0, 0, .14);-webkit-box-shadow:0 0 15px rgba(0, 0, 0, .14)}#dialogsClose{float:right;width:10px;height:10px;padding:5px;padding-top:0;cursor:pointer}#dialogsTitle{font-size:18px;font-weight:500;line-height:1.2;text-align:left}#dialogMsg{padding:10px;font-size:14px;line-height:1.6;text-align:center}.dialog_btn{padding:5px 0 0;text-align:right;font-size: 0;}.dialog_btn a:nth-child(2) {margin-left: 10px;}.dialog_btn a{display:inline-block;line-height:1;white-space:nowrap;cursor:pointer;background:#fff;border:1px solid #dcdfe6;color:#606266;-webkit-appearance:none;text-align:center;box-sizing:border-box;outline:none;margin:0;font-weight:500;-moz-user-select:none;-webkit-user-select:none;-ms-user-select:none;padding:12px 20px;font-size:14px;border-radius:4px;padding:9px 15px;font-size:12px;border-radius:3px;text-decoration:none}#dialogSure{color:#fff;background-color:#409eff;border-color:#409eff}</style>'+'<div id=dialogs><div id=dialogsMask></div><div class=dialogs_body><img id=dialogsClose src="data:image/png;base64,"><div id=dialogsTitle></div><div id=dialogMsg></div><div class=dialog_btn><a href="javascript:;" id=dialogCancel>取消</a><a href="javascript:;" id=dialogSure>确定</a></div></div></div>';document.body.appendChild(div);var box=document.getElementById("dialogsBox"),dialogs=document.getElementById("dialogs"),dialogsTitle=document.getElementById("dialogsTitle"),dialogMsg=document.getElementById("dialogMsg"),dialogCancel=document.getElementById("dialogCancel"),dialogsClose=this.document.getElementById("dialogsClose"),dialogSure=document.getElementById("dialogSure");if(typeof callback!=="function"){title=callback;callback=""}dialogs.style.display="block";title?dialogsTitle.innerHTML=title.toString():dialogsTitle.innerHTML="";dialogMsg.innerHTML=msg.toString();dialogCancel.onclick=function(){dialogs.style.display="none";document.body.removeChild(box)};dialogsClose.onclick=function(){dialogs.style.display="none";document.body.removeChild(box)};if(!callback){dialogCancel.style.display="none";document.getElementById("dialogsMask").onclick=function(){dialogs.style.display="none";document.body.removeChild(box)}}else{dialogCancel.style.display="inline-block";document.getElementById("dialogsMask").onclick=function(){return false}}dialogSure.onclick=function(){dialogs.style.display="none";document.body.removeChild(box);callback&&callback()}};
